s[202] = "spdNFe.TspdCustomNFe.PreverDanfe^spdNFe.TspdCustomNFe.html#PreverDanfe^^Permite Prever como será impresso um DANFE    aLoteNotas XML de Notas Assinado aArquivoModelo caminho para arquivo de modelo do DANFE (extensão RTM), se deixar em branco será utilizado o modelo padrão, localizado no diretório de Templates, subdiretório Danfe  ^0"
s[203] = "spdNFe.TspdCustomNFe.ExportarPreverDanfe^spdNFe.TspdCustomNFe.html#ExportarPreverDanfe^^Permite Exportar um PDF de previsão de como será impresso um DANFE     aLoteNotas XML de Notas Assinado aArquivoModelo caminho para arquivo de modelo do DANFE (extensão RTM), se deixar em branco será utilizado o modelo padrão, localizado no diretório de Templates, subdiretório Danfe aLocalNomeArquivo Local e Nome de onde o arquivo será salvo  ^0"
s[204] = "spdNFe.TspdCustomNFe.VisualizarDanfe^spdNFe.TspdCustomNFe.html#VisualizarDanfe^^Permite visualizar um documento DANFE para o Lote de Notas passado como parâmetro em xml.   passar o XML Destinatário que contém os dados de Autorização da NFe.   aNumLote Número de Identificação do Lote de notas a ser visualizado. aLoteNotas xml válido contendo Notas Fiscais eletrônicas (NFe). Em caso de Missão em FS passar somente o XMLAssinado, caso contrário aArquivoModelo caminho para arquivo de modelo do DANFE (extensão RTM), se deixar em branco será utilizado o modelo padrão, localizado no diretório de Templates, subdiretório Danfe  ^0"
s[205] = "spdNFe.TspdCustomNFe.ImprimirDanfe^spdNFe.TspdCustomNFe.html#ImprimirDanfe^^Permite imprimir um documento DANFE para o Lote de Notas passado como parâmetro em xml.   passar o XML Destinatário que contém os dados de Autorização da NFe.   aNumLote Número de Identificação do Lote de notas a ser impresso. aLoteNotas xml válido contendo Notas Fiscais eletrônicas (NFe). Em caso de Missão em FS passar somente o XMLAssinado, caso contrário aArquivoModelo caminho para arquivo de modelo do DANFE (extensão RTM), se deixar em branco será utilizado o modelo padrão, localizado no diretório de Templates, subdiretório Danfe  ^0"
s[206] = "spdNFe.TspdCustomNFe.ImprimirDanfeXmlDiretorio^spdNFe.TspdCustomNFe.html#ImprimirDanfeXmlDiretorio^^Permite imprimir xmls que estão contidos dentro de um pasta.  .    aDiretorioXml Endereço do diretório de xmls a ser impresso. aArquivoModelo caminho para arquivo de modelo do DANFE (extensão RTM), se deixar em branco será utilizado o modelo padrão, localizado no diretório de Templates, subdiretório Danfe aExportarArquivoPara Exporta os arquivos pdf para este endereço. aImpressora Nome da impressora.  ^0"
s[207] = "spdNFe.TspdCustomNFe.EditarModeloDanfe^spdNFe.TspdCustomNFe.html#EditarModeloDanfe^^Permite editar o modelo para impressão do DANFE. Para utilizar o modelo alterado, é necessário salvar o arquivo com extensão RTM e utilizá-lo nas chamadas de <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#VisualizarDanfe\">VisualizarDanfe</a> e <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#ImprimirDanfe\">ImprimirDanfe</a>. Os parâmetro do método são os mesmos dos citados, para permitir a edição de um relatório com os campos preenchidos   passar o XML Destinatário que contém os dados de Autorização da NFe.   aNumLote Número de Identificação do Lote de notas a ser impresso. aLoteNotas xml válido contendo Notas Fiscais eletrônicas (NFe). Em caso de Missão em FS passar somente o XMLAssinado, caso contrário aArquivoModelo caminho para arquivo de modelo do DANFE (extensão RTM), se deixar em branco será utilizado o modelo padrão, localizado no diretório de Templates, subdiretório Danfe  ^0"
s[208] = "spdNFe.TspdCustomNFe.ExportarDanfe^spdNFe.TspdCustomNFe.html#ExportarDanfe^^Permite exportar a DANFE para os formatos PDF e JPG.   passar o XML Destinatário que contém os dados de Autorização da NFe.     aNumLote número do lote da NFe aLoteNotas xml válido contendo Notas Fiscais eletrônicas (NFe). Em caso de Missão em FS passar somente o XMLAssinado, caso contrário aArquivoModelo caminho para arquivo de modelo do DANFE (extensão RTM), se deixar em branco será utilizado o modelo padrão, localizado no diretório de Templates, subdiretório Danfe, com o nome modelo.RTM aFormato valor inteiro que corresponde ao formato desejado. Escolha 1 para PDF e 2 para JPG. O valor padrão é 1. aExportarParaArquivo local onde o arquivo será gravado, se for vazio o componente pedirá um local para gravar  ^0"
