s[305] = "spdNFe.TspdNFe.AuditarXml^spdNFe.TspdNFe.html#AuditarXml^^Função para a validação do auditor fiscal           aXml: xml passado para a validação. aDelimitador: Delimitador necessário para a validação. aServidor: Necessário informar servidor para dar a resposta da validação. aExibirRegra: Exibição das regras de validação. aExibirHtml: Exibição da validação em HTML. aParam: parâmetro não necessário, somente para caso precise futuramente. Retorna um tipo de validação dependendo das propriedades setadas. EspdNFeValidadorClientOCXException: Quando o validadorClient não é instanciado. EspdNFeComunicacaoValidadorNotaException: Quando a comunicação com a validação falhar.^0"
s[306] = "spdNFe.TspdNFe.EnviarManifestacaoDestinatario^spdNFe.TspdNFe.html#EnviarManifestacaoDestinatario^^Função para o envio de Manifestação de Destinatário.  1: Confirmação da operação (tmdConfirmacaoOperacao). 2: Ciência da operação (tmdCienciaOperacao). 3: Desconhecimento da operação (tmdDesconhecimentoOperacao). 4: Operação não Realizada (tmdOperacaoNaoRealizada).                aTpEvento tipo do evento que deseja enviar: aNotaID Chave de Acesso da NF-e vinculada ao Evento. aCNPJCPF Informar o <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#CNPJ\">CNPJ</a> ou o CPF do autor do Evento. aJustificativa Justificativa para manifestação. aDataHoraEvento Data e Hora do evento. aSequencia Número sequêncial do evento. aFusoHorario Fuso horário. aCOrgao Parâmetro para forçar o componente a enviar dados para o <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#Ambiente\">ambiente</a> nacional. Inserir aCorgao = '91' Retorna XML contendo mensaegm do resultado da solicitação. EspdNFeEventosFusoHorarioInvalidException quando formato fuso horário informado é inválido. EspdNFeEventosDataHoraInvalidException quando Data Hora informada é inválida. EspdNFeEventosUFInvalidException quando <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#UF\">UF</a> não é definida. EspdNFeEventosChaveInvalidException quando Chave da NFe informada é inválida. EspdNFeEventosCodigoOrgaoInvalidException quando código do orgão é inválido. EspdNFeEventosJustificativaInvalidException quando justificativa informada é inválida^0"
s[307] = "spdNFe.TspdNFe.ConsultarNFeDestinadas^spdNFe.TspdNFe.html#ConsultarNFeDestinadas^^Função de &quot;Consulta da Relação de Documentos Destinados para um determinado <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#CNPJ\">CNPJ</a> de destinatário informado na NF-e.  2 para &quot;Idem anterior, incluindo as NF-e que também não tiveram a Ciência da Operação&quot;)  1 para &quot;Somente as NF-e emitidas por emissores / remetentes que não tenham a mesma raiz do <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#CNPJ\">CNPJ</a> do destinatário (para excluir as notas fiscais de transferência entre filiais)&quot;)  consulta retornará unicamente as notas fiscais que tenham sido recepcionadas nos últimos 15 dias)      </p>    <pre class=\"longcode\">      Ex:      _Result := ConsultarNFeDestinadas(<span class=\"pascal_numeric\">0</span>, <span class=\"pascal_numeric\">0</span>, <span class=\"pascal_string\">'999'</span>);     </pre>    <p>  aIndNFe Indicador de NF-e consultada. Utilizar: (0 para &quot;Todas as NF-e&quot;; 1 para &quot;Somente as NF-e sem manifestação&quot;; aIndEmi Indicador do Emissor da NF-e. Utilizar: (0 para &quot;Todos os Emitentes / Remetentes&quot;; aUltNSU Último NSU recebido pela Empresa (Caso seja informado com zero, ou com um NSU muito antigo, a Retorna XML contendo mensaegm do resultado da solicitação. EspdNFeEventosCNPJInvalidException quando <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#CNPJ\">CNPJ</a> configurado é inválido EspdNFeEventosIndNFeInvalidException quando indicador de NFe é inválido EspdNFeEventosIndEmiInvalidException quando indicador de emitente é inválido EspdNFeEventosUltNSUInvalidException quando Último Número Sequêncial Único (NSU é inválido)^0"
s[308] = "spdNFe.TspdNFe.ConsultarDistribuicaoDFe^spdNFe.TspdNFe.html#ConsultarDistribuicaoDFe^^Função de &quot;Consulta da Relação de Documentos a serem distribuidos para determinado CPF ou <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#CNPJ\">CNPJ</a> de acordo com a NF-e.&quot;           </p>    <pre class=\"longcode\">      Ex:      Por CPF utilizando Ultimo NSU:      _Result := ConsultarDistribuicaoDFe(<span class=\"pascal_string\">'41'</span>, <span class=\"pascal_string\">'12345678900'</span>);        Por CNPJ utilizando NSU especifico:      _Result := ConsultarDistribuicaoDFe(<span class=\"pascal_string\">'41'</span>, <span class=\"pascal_string\">'12345678912345'</span>, <span class=\"pascal_string\">'000000000000015'</span>, nkEspecifico);     </pre>    <p>  aCodigoUF - Código da <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#UF\">UF</a> que sera feita a consulta DF-e. Ex: 41 (PARANÁ) aCNPJCPF - CPF ou <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#CNPJ\">CNPJ</a> que solicitou a Distribuição DF-e. Ex: &quot;12345678912&quot; ou &quot;12345678911234&quot; aNSU - Número NSU (Número Sequencial Unico) para consulta. Ex: &quot;000000000000001&quot; aTipoNSU - Tipo do NSU, o tipo que será utilizado para requisição Especifico ou o Ultimo. Ex: nkEspecifico Retorna Os XMLs Destinados pela busca do NSU. EspdNFeDFeUFInvalidaException quando o código da <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#UF\">UF</a> configurada é inválido EspdNFeDFeCNPJInvalidoException quando <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#CNPJ\">CNPJ</a> configurado é inválido EspdNFeDFeCPFInvalidoException quando CPF configurado é inválido EspdNFeDFeNSUInvalidaException quando NSU configurado é inválido EspdNFeDFeException quando houve algum problema na requisição.^0"
s[309] = "spdNFe.TspdNFe.ConsultarDistribuicaoDFeChave^spdNFe.TspdNFe.html#ConsultarDistribuicaoDFeChave^^Função de &quot;Consulta da Relação de Documentos a serem distribuidos para determinado CPF ou <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#CNPJ\">CNPJ</a> de acordo com a NF-e.&quot;          </p>    <pre class=\"longcode\">      Ex:      Por CPF utilizando Ultimo NSU:      _Result := ConsultaDistribuicaoDFeChave(<span class=\"pascal_string\">'41'</span>, <span class=\"pascal_string\">'12345678900'</span>, <span class=\"pascal_string\">'00000000000000000000000000000000000000000000'</span>);       </pre>    <p>  aCodigoUF - Código da <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#UF\">UF</a> que sera feita a consulta DF-e. Ex: 41 (PARANÁ) aCNPJCPF - CPF ou <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#CNPJ\">CNPJ</a> que solicitou a Distribuição DF-e. Ex: &quot;12345678912&quot; ou &quot;12345678911234&quot; aChave - Chave da NFe a ser consultada. EX : 00000000000000000000000000000000000000000000 Retorna Os XMLs Destinados pela busca da chave. EspdNFeDFeUFInvalidaException quando o código da <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#UF\">UF</a> configurada é inválido EspdNFeDFeCNPJInvalidoException quando <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#CNPJ\">CNPJ</a> configurado é inválido EspdNFeDFeCPFInvalidoException quando CPF configurado é inválido EspdNFeDFeChaveInvalidaException quando Chave informada diferente de 44 caracteres EspdNFeDFeException quando houve algum problema na requisição.^0"
s[310] = "spdNFe.TspdNFe.DescompactarXMLZip^spdNFe.TspdNFe.html#DescompactarXMLZip^^Função para descompactação de xml's zipados que podem ser provenientes por exemplo de consultas de distribuição DFe  @raise (<a class=\"normal\"  href=\"spdNFeException.EspdNFeDescompactarXMLException.html\">EspdNFeDescompactarXMLException</a> quando houver algum problema na tentativa de descompactação.)  aXML - String contendo o conteúdo do XML compactado.  ^0"
s[311] = "spdNFe.TspdNFe.DownloadNFe^spdNFe.TspdNFe.html#DownloadNFe^^Função de &quot;Download NFe&quot; do servidor da Sefaz.       </p>    <pre class=\"longcode\">      Ex:      _Result := DownloadNFe(<span class=\"pascal_string\">'098909012345555090290124509890223879820934212,098909012345555090290124509890223879820934212'</span>);     </pre>    <p>  aChaves Chave das NF-e que seja realizar download (Seperadas por vírgula) aCOrgao Parâmetro para forçar o componente a enviar dados para o <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#Ambiente\">ambiente</a> nacional. Inserir aCorgao = '91' Retorna XML contendo mensaegm do resultado da solicitação. EspdNFeEventosCNPJInvalidException quando <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#CNPJ\">CNPJ</a> configurado é inválido EspdNFeEventosChaveInvalidException quando pelo menos uma das chaves informadas é inválida EspdNFeEventoDownloadLimitNotasException quando informado mais que 10 chaves^0"
s[312] = "spdNFe.TspdNFe.TratarXMLRetornoDFe^spdNFe.TspdNFe.html#TratarXMLRetornoDFe^^Função para descompactar e gravar em disco o retorno da DistribuicaoDFe    aXML parametro com o xml de retorno da DistribuicaoDFe aDiretorio parametro com o diretorio onde será salvo os arquivos xmls  ^0"
s[313] = "spdNFe.TspdNFe.ValidarLoteParaEnvio^spdNFe.TspdNFe.html#ValidarLoteParaEnvio^^Valida Lote de Notas, realizando vários procedimentos, desde verificação de assinatura, até validação do xml de acordo com o esquema requerido para envio das notas      aNumLote Número do lote de notas, para montagem do xml aLoteNotas Lote de Notas a ser avaliado  EspdNFeSchemaNotFoundException Quando o XML não puder ser validado por não indicar o arquivo esquema EspdNFeCheckParams Levantada quando os parâmetros estiverem com acento ou diferentes do tamanho exigido.^0"
