s[320] = "spdNFe.TspdNFe.CalculaChaveNFe^spdNFe.TspdNFe.html#CalculaChaveNFe^^Função que calcula a Chave da NFe          aDtEmissao Data de Emissão do Documento no formato YYYY-MM-DD aUF Código do Estado do Emissor da NFe aCNPJ <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#CNPJ\">CNPJ</a>/CPF do Emitente contendo apenas numeros aModelo Modelo do Documento Fiscal que está sendo Emitido aSerie Serieo do Documento Fiscal que está sendo Emitido aNRNota Número da Nota Fiscal registrada no sistema aCodSistema Número Identificador da NF dentro do banco de dados da empresa aTpEmis Tipo de Emissão da NFe - Utilizado a partir da versão 4.0 do Manual de integração  ^0"
