s[323] = "spdNFe.TspdNFe.ConverterLoteParaXml^spdNFe.TspdNFe.html#ConverterLoteParaXml^^Função que converte um Lote de Nf's formato TXT para XML       ArquivoLoteTxt arquivo com Lote de NF's em formato TXT aLayoutConv Modo de conversão <a class=\"normal\"  href=\"spdNFeType.html#TLayoutConvKind\">TLayoutConvKind</a> (Tx2/Rec) aVersaoEsquema Versão do esquema que será utilizado na conversão aExportacao Utilizado para setar a conversão da NFe normal (False) ou de exportação (True). Lote de entrada convertido para formato XML ^0"
