s[325] = "spdNFe.TspdNFe.CancelarNF^spdNFe.TspdNFe.html#CancelarNF^^Função que envia solicitação de Cancelamento da NF     </p>    <pre class=\"longcode\">      Ex:      _Result := CancelarNF(<span class=\"pascal_string\">'098909012345555090290124509890223879820934212'</span>,<span class=\"pascal_string\">'098950000123463'</span>,<span class=\"pascal_string\">'emitente incorreto'</span>);</pre>    <p>   aNotaID Chave de Identificação da NF aNumProtocolo Número do Protocolo de registro da NF, que deve conter exatamente 15 dígitos aJustificativa Texto (mínimo 15 dígitos) para descrição do Motivo de cancelamento da NF XML com o resultado da operação solicitada EspdNFeCheckParams Levantada quando os parâmetros estiverem com acento ou diferentes do tamanho exigido.^0"
s[326] = "spdNFe.TspdNFe.CancelarNFeEvento^spdNFe.TspdNFe.html#CancelarNFeEvento^^Função que envia solicitação de Cancelamento de uma NFe como um evento.                </p>    <pre class=\"longcode\">      Ex:      _Result := CancelarNFeEvento(<span class=\"pascal_string\">'098909012345555090290124509890223879820934212'</span>,<span class=\"pascal_string\">'098950000123463'</span>,<span class=\"pascal_string\">'emitente incorreto'</span>,      <span class=\"pascal_string\">'2012-05-15T15:30:30'</span>, <span class=\"pascal_numeric\">1</span>, <span class=\"pascal_string\">'-03:00'</span>);     </pre>    <p>  aNotaID Chave de Identificação da NF aNumProtocolo Número do Protocolo de registro da NF, que deve conter exatamente 15 dígitos aJustificativa Texto (mínimo 15 dígitos) para descrição do Motivo de cancelamento da NF aDataHoraEvento Data e Hora da Emissão do Evento Ex.: 2010-08-19T13:00:15 aFusoHorario Fuso horário do local de envio. Ex.: -03:00 aConfigFilePath caminho para um arquivo ini com configurações aSequenciaEvento é o numero do evento XML com o resultado da operação solicitada. EspdNFeEventosNumeroProtException Quando número do protocolo não é informado EspdNFeEventosFusoHorarioInvalidException quando formato fuso horário informado é inválido. EspdNFeEventosDataHoraInvalidException quando Data Hora informada é inválida. EspdNFeEventosUFInvalidException quando <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#UF\">UF</a> não é definida. EspdNFeEventosChaveInvalidException quando Chave da NFe informada é inválida. EspdNFeEventosCodigoOrgaoInvalidException quando código do orgão é inválido. EspdNFeEventosJustificativaInvalidException quando justificativa informada é inválida^0"
s[327] = "spdNFe.TspdNFe.ConsultarNF^spdNFe.TspdNFe.html#ConsultarNF^^Função para consultar NF no servidor   </p>    <pre class=\"longcode\">      Ex:      _Result := ConsultaNF(<span class=\"pascal_string\">'098909012345555090290124509890223879820934212'</span>); </pre>    <p>   aNotaID Chave de Identificação da NF XML com o resultado da operação solicitada EspdNFeCheckParams Levantada quando os parâmetros estiverem com acento ou diferentes do tamanho exigido.^0"
s[328] = "spdNFe.TspdNFe.CalculaChaveInutilizacao^spdNFe.TspdNFe.html#CalculaChaveInutilizacao^^Função que calcula a Chave da Inutilização de NFe        aAno Ano de inutilização da numeração no formato YY aCNPJ <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#CNPJ\">CNPJ</a>/CPF do emitente aModelo Modelo da NFe aSérie Série da NFe aNFIni Número da NFe inicial a ser inutilizada aNFFin Número da NFe final a ser inutilizada  ^0"
s[329] = "spdNFe.TspdNFe.InutilizarNF^spdNFe.TspdNFe.html#InutilizarNF^^Função que solicita a Inutilização de Numeração.  &quot;ID&quot; + Código <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#UF\">UF</a> + Ano + CNPJCPF + Modelo + Serie + NrInicial + NrFinal. Esse paramnetro pode ser deixado vazio para que o componente auto preencha o seu valor, baseado nos próximos parametros.          aNotaID Refere-se ao identificador DP04 descrito no Manual de Integração, que é resultado da concatenação dos campos: aAno Ano de inutilização da numeração aCNPJ <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#CNPJ\">CNPJ</a>/CPF do emitente aModelo Modelo da NFe aSérie Série da NFe aNFIni Número da NFe inicial a ser inutilizada aNFFin Número da NFe final a ser inutilizada aJustificativa Justificativa para a Inutilização da Faixa de Notas XML contendo a mensagem do resultado da solicitação ^0"
s[330] = "spdNFe.TspdNFe.EnviarNF^spdNFe.TspdNFe.html#EnviarNF^^Função para Enviar Lote das NF's assinadas.      aNumLote Número de Identificação do Lote a ser enviado. aLoteNotas XML das NF's Assinadas encapsuladas no Lote. Xml contendo mensagem do resultado da solicitaçao. EspdNFeCheckParams Levantada quando os parâmetros estiverem com acento ou diferentes do tamanho exigido.^0"
s[331] = "spdNFe.TspdNFe.EnviarNFSincrono^spdNFe.TspdNFe.html#EnviarNFSincrono^^Função para Enviar Lote das NF's assinadas no modo síncrono. O Lote de notas para o modo síncrono deve conter somente uma nota.       aNumLote Número de Identificação do Lote a ser enviado. aLoteNota XML da NF-e Assinada e encapsulada no Lote. aCompactado define se o XML enviado será normal ou compactado. Xml contendo mensagem do resultado da solicitaçao. EspdNFeCheckParams Levantada quando os parâmetros estiverem com acento ou diferentes do tamanho exigido.^0"
s[332] = "spdNFe.TspdNFe.ConsultarRecibo^spdNFe.TspdNFe.html#ConsultarRecibo^^Função que verifica a Situação do Recibo (que pode conter várias NFs).   </p>    <pre class=\"longcode\">      ex:      _Result := ConsultarRecibo(<span class=\"pascal_string\">'009098765436527'</span>); </pre>    <p>   aNumRecibo Número do Recibo que deve conter 15 dígitos. Retorna Xml contendo mensagem do resultado da solicitação. EspdNFeCheckParams Levantada quando os parâmetros estiverem com acento ou diferentes do tamanho exigido.^0"
s[333] = "spdNFe.TspdNFe.ConsultarCadastro^spdNFe.TspdNFe.html#ConsultarCadastro^^Função para consultar cadastro do Contribuinte ICMS      aDocumento Número do Documento a ser consultado. aTpDocumento que será consultado. Utilizar (<a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#CNPJ\">CNPJ</a>, IE, CPF) aUF <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#UF\">UF</a> do documento que está sendo consultado Retorna XML contendo mensaegm do resultado da solicitação.(Dados do Contribuinte) ^0"
s[334] = "spdNFe.TspdNFe.ListarLogs^spdNFe.TspdNFe.html#ListarLogs^^Lista todos os logs ou filtra de acordo com o filtro passado em aFilter    <p>Os tipos de filtro que podem ser passado em aFilter são: </p>    <dl class=\"paragraph_spacing\">    <dt>lfXml</dt>    <dd><p>lista todos os arquivos XML. É o valor padrão.</p></dd>    <dt>lfNfe</dt>    <dd><p>lista arquivos de NFe.</p></dd>    <dt>lfEnvLot</dt>    <dd><p>lista arquivos de envio de lote de NFe.</p></dd>    <dt>lfRec</dt>    <dd><p>lista arquivos de recibo.</p></dd>    <dt>lfPedRec</dt>    <dd><p>lista arquivos de pedido do resultado do processamento do lote de NFe.</p></dd>    <dt>lfProRec</dt>    <dd><p>lista arquivos de resultado do processamento do lote de NFe.</p></dd>    <dt>lfDen</dt>    <dd><p>lista arquivos de denegação de uso.</p></dd>    <dt>lfPedCan</dt>    <dd><p>lista arquivos de pedido de cancelamento de NFe.</p></dd>    <dt>lfCan</dt>    <dd><p>lista arquivos de cancelamento de NFe.</p></dd>    <dt>lfPedInu</dt>    <dd><p>lista arquivos de pedido de inutilização de numeração.</p></dd>    <dt>lfInu</dt>    <dd><p>lista arquivos de inutilização de numeração.</p></dd>    <dt>lfPedSit</dt>    <dd><p>lista arquivos de pedido de consulta de situação atual da NFe.</p></dd>    <dt>lfSit</dt>    <dd><p>lista arquivos de situação atual da NF-e.</p></dd>    <dt>lfPedSta</dt>    <dd><p>lista arquivos de pedido de consulta de status do serviço.</p></dd>    <dt>lfSta</dt>    <dd><p>lista arquivos de status de serviço.</p></dd>    <dt>lfCustom</dt>    <dd><p>lista arquivos obtidos através de um filtro personalizado pelo usuário em aCustomFilter.</p></dd>  </dl>    <p>    ^0"
s[335] = "spdNFe.TspdNFe.LerLog^spdNFe.TspdNFe.html#LerLog^^Lê o conteúdo do arquivo de <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#Log\">log</a> especificado em aPathArquivoLog e retorna o valor em uma WideString     <p>Exemplo: </p>    <pre class=\"longcode\">LerLog(<span class=\"pascal_string\">'c:\\NFE\\log\\0001-env-lot.xml'</span>)</pre>    <p>  aPathArquivoLof caminho completo para o arquivo do <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#Log\">log</a>.  ^0"
s[336] = "spdNFe.TspdNFe.VisualizarDanfeLog^spdNFe.TspdNFe.html#VisualizarDanfeLog^^Abre o visualizador de DANFE com o arquivo especificado em aPathArquivoLog. O arquivo deve conter o XML de uma NFe enviada (arquivos com sufixo -env-lot.xml).     <p>Exemplo: </p>    <pre class=\"longcode\">VisualizarDanfeLog(<span class=\"pascal_string\">'c:\\NFE\\log\\0001-env-lot.xml'</span>)</pre>    <p>  aPathArquivoLof caminho completo para o arquivo do <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#Log\">log</a>.  ^0"
s[337] = "spdNFe.TspdNFe.GerarXMLEnvioDestinatario^spdNFe.TspdNFe.html#GerarXMLEnvioDestinatario^^Gerar XML no Padrão da SEFAZ a ser Enviado ao Destinatário        aXMLAssinado XML da NFe Assinada que será enviada ao Destinatário aLogConsRecibo Arquivo de <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#Log\">Log</a> referente a consulta do Recibo de Entrega ao WS do SEFAZ aSalvarComo Parâmetro a ser utilizado caso necessite Salvar o Arquivo XML de Envio. XML Padrão da SEFAZ para Envio ao Destinatário EspdNFeCheckParams Caso algum dos parâmetros aAssinado ou aLogConsRecibo estiverem Vazio EspdNFeLogNotFoundException Caso o parâmetro aLogConsRecibo se referir a um arquivo Inexistente^0"
s[338] = "spdNFe.TspdNFe.EnviarNotaDestinatario^spdNFe.TspdNFe.html#EnviarNotaDestinatario^^Metodo responsavel pelo envio dos arquivos ao destinatario da nota       aNumLote Número de Identificação do Lote a ser enviado. aLoteNotas XML das NF's encapsuladas no Lote. aLog Arquivo de <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#Log\">Log</a> referente a consulta do Recibo de Entrega ao WS do SEFAZ ArquivoNota nome do arquivo xml a ser gerado ArquivoDanfe nome do arquivo da Danfe a ser gerado  ^0"
s[339] = "spdNFe.TspdNFe.EnviarNotaDestinatarioAnexos^spdNFe.TspdNFe.html#EnviarNotaDestinatarioAnexos^^Metodo responsavel pelo envio dos arquivos ao destinatario da nota     aArquivoPDF Arquivo PDF da Danfe que será anexada aArquivoXML Arquivo padrão Sefaz de distribuição ao destinatário que será anexado no email. aOutros Qualquer outro arquivo que será anexado como por exemplo: PDF de boleto bancário  ^0"
s[340] = "spdNFe.TspdNFe.GerarXMLCancelamentoDestinatario^spdNFe.TspdNFe.html#GerarXMLCancelamentoDestinatario^^Função responsavel por gerar XML de Cancelamento que deve ser distribuído ao Destinatário      aIDNFe Chave da Nota que deseja gerar o arquivo aContentLogPedCanc Conteúdo ou diretório do arquivo <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#Log\">Log</a> de Pedido de Cancelamento prefixo &quot;ped-can&quot; aContentLogRetCanc Conteúdo ou diretório do arquivo <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#Log\">Log</a> de Retorno de Cancelamento prefixo &quot;can&quot; aSalvarComo Caso informado esse parametro salva em arquivo o conteúdo gerado pela função  ^0"
s[341] = "spdNFe.TspdNFe.EnviarNotaCanceladaDestinatario^spdNFe.TspdNFe.html#EnviarNotaCanceladaDestinatario^^Metodo que baseado em Logs de Cancelamento monta o XML padronizado pelo sefaz e o envia por email ao destinatário      aIDNFe Chave da Nota que deseja gerar o arquivo aLogPedCanc Arquivo <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#Log\">Log</a> de Pedido de Cancelamento prefixo &quot;ped-can&quot; aLogRetCanc Arquivo do <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#Log\">Log</a> de Retorno de Cancelamento prefixo &quot;can&quot; aEmailDestinatario Informar para qual e-mail o arquivo gerado será enviado. Caso não seja informado o componente obtém o email configurado em EmailSettings.EmailDestinatario  ^0"
s[342] = "spdNFe.TspdNFe.ValidarArquivoXmlDestinatario^spdNFe.TspdNFe.html#ValidarArquivoXmlDestinatario^^Função utilizada para checar a integridade do XMLDestinatário    aXml Xml que será avaliado aErrorList Lista de Erros que foram encontrados na validação do XML  ^0"
s[343] = "spdNFe.TspdNFe.ValidarLoteItem^spdNFe.TspdNFe.html#ValidarLoteItem^^Valida Lote de Notas, realizando vários procedimentos, desde verificação de assinatura, até validação do xml de acordo com o esquema requerido para envio das notas      aNumLote Número do lote de notas, para montagem do xml aLoteNotas Lote de Notas a ser avaliado  EspdNFeSchemaNotFoundException Quando o XML não puder ser validado por não indicar o arquivo esquema EspdNFeCheckParams Levantada quando os parâmetros estiverem com acento ou diferentes do tamanho exigido.^0"
s[344] = "spdNFe.TspdNFe.ConverteXmlParaDataSet^spdNFe.TspdNFe.html#ConverteXmlParaDataSet^^Função criada para conveter dados de um XML de NFe válido para um DataSet populado.    aXML Conteúdo do arquivo xml  EspdNFeDataSetException Quando não conseguir conveter o xml para um dataset^0"
s[345] = "spdNFe.TspdNFe.EnviarCCe^spdNFe.TspdNFe.html#EnviarCCe^^Metodo responsavel pelo envio de carta de correção eletrônica      aIdLote Número de Identificação do Lote a ser enviado. aXmlCCe XML da CCe Assinada Xml contendo mensagem do resultado da solicitaçao. EspdNFeCheckParams Levantada quando os parâmetros estiverem com acento ou diferentes do tamanho exigido.^0"
s[346] = "spdNFe.TspdNFe.EnviarCCe^spdNFe.TspdNFe.html#EnviarCCe^^Metodo responsavel pelo envio de carta de correção eletrônica         aNotaID Chave de Identificação da NF. aTextoCorrecao Texto (mínimo 15 dígitos) para descrição da correção. aDataHoraEvento Data e Hora da Emissão do Evento. Ex.: 2010-08-19T13:00:15 aOrgao Código do Estado do Emissor da NFe. aIdLote ID do Lote da nota no qual a CCe será vinculada. aSequenciaEvento Número do evento (sequencial) aFusoHorario Fuso horário do local de envio. Ex.: -03:00  ^0"
s[347] = "spdNFe.TspdNFe.EnviarPedidoProrrogacao^spdNFe.TspdNFe.html#EnviarPedidoProrrogacao^^Metodo responsavel pelo envio do Pedido de Prorrogação      aIdLote Número de Identificação do Lote a ser enviado. aXmlPedProrrogacao XML do Pedido assinado. Xml contendo mensagem do resultado da solicitaçao. EspdNFeCheckParams Levantada quando os parâmetros estiverem com acento ou diferentes do tamanho exigido.^0"
s[348] = "spdNFe.TspdNFe.AdicionarItens^spdNFe.TspdNFe.html#AdicionarItens^^Método responsável para popular os dados pedido e quantidade, para utilização no método: <a class=\"normal\"  href=\"spdNFe.TspdNFe.html#EnviarPedidoProrrogacao\">EnviarPedidoProrrogacao</a>    aNumItens: número do Item aQtdeItens: quantidade do Item  ^0"
s[349] = "spdNFe.TspdNFe.EnviarPedidoProrrogacao^spdNFe.TspdNFe.html#EnviarPedidoProrrogacao^^Metodo responsavel pelo envio do Pedido de Prorrogação          aIdLote Id do lote a ser enviado. aChaveNFe Chave da NF-e que possui os itens a serem prorrogados. aNumProtocolo Número do protocólo de autorização da NF-e a ser prorrogada. aDataHoraEvento Data e Hora da Emissão do Evento. Ex.: 2010-08-19T13:00:15 aOrgao Código do Estado do Emissor da NFe. aTpEvento Tipo do evento EPP1=111500 ou EPP2=111501 aSequenciaEvento Número do evento (sequencial) aFusoHorario Fuso horário do local de envio. Ex.: -03:00  ^0"
s[350] = "spdNFe.TspdNFe.CancelarPedidoProrrogacao^spdNFe.TspdNFe.html#CancelarPedidoProrrogacao^^Metodo responsavel pelo envio de Cancelamento do Pedido de Prorrogação          aIdLote Id do lote a ser enviado. aChaveNFe Chave da NF-e que possui Pedido de Prorrgação a ser cancelado. aIdEvento Chave do evento de Pedido de Prorrogação autorizado. aNumProtocolo Número do protocólo de autorização da NF-e a ser prorrogada. aDataHoraEvento Data e Hora da Emissão do Evento. Ex.: 2010-08-19T13:00:15 aTpEvento Tipo do evento CEPP1=111502 ou CEPP2=111503 aSequenciaEvento Número do evento (sequencial) aFusoHorario Fuso horário do local de envio. Ex.: -03:00  ^0"
s[351] = "spdNFe.TspdNFe.GerarXMLCCeDestinatario^spdNFe.TspdNFe.html#GerarXMLCCeDestinatario^^Função responsavel por gerar XML de CCe que deve ser enviado ao Destinatário      aIDEvento Chave da CCe que deseja gerar o arquivo aLogEvento Conteúdo do <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#Log\">Log</a> de Envio da CCe aLogRetEvento Conteúdo do <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#Log\">Log</a> de Retorno da CCe aSalvarComo Caso informado esse parametro salva em arquivo o conteúdo gerado pela função  ^0"
s[352] = "spdNFe.TspdNFe.GerarXMLManifestoDestinatario^spdNFe.TspdNFe.html#GerarXMLManifestoDestinatario^^Função responsavel por gerar XML de Manifestação que deve ser enviado ao Destinatário      aIDEvento Chave da Manifestação que deseja gerar o arquivo aLogEvento Conteúdo do <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#Log\">Log</a> de Envio da Manifestação aLogRetEvento Conteúdo do <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#Log\">Log</a> de Retorno da Manifestação aSalvarComo Caso informado esse parametro salva em arquivo o conteúdo gerado pela função  ^0"
s[353] = "spdNFe.TspdNFe.GerarXMLEPECDestinatario^spdNFe.TspdNFe.html#GerarXMLEPECDestinatario^^Função responsavel por gerar XML de EPEC que deve ser enviado ao Destinatário      aIDEvento Chave do EPEC que deseja gerar o arquivo aLogEvento Conteúdo do <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#Log\">Log</a> de Envio do EPEC aLogRetEvento Conteúdo do <a class=\"normal\"  href=\"spdNFe.TspdCustomNFe.html#Log\">Log</a> de Retorno do EPEC aSalvarComo Caso informado esse parametro salva em arquivo o conteúdo gerado pela função  ^0"
s[354] = "spdNFe.TspdNFe.ImprimirEPEC^spdNFe.TspdNFe.html#ImprimirEPEC^^Método utilizado para Imprimir a DANFE em contingência EPEC       aLoteNotas Lote XML de NFe Assinado aProtEPEC Número de Protocolo obtido após envio ao WebService de EPEC aDataHoraEPEC Data e Hora de recebimento do EPEC no WebService aArquivoModelo Arquivo (rtm) de layot de impressão (opcional) aImpressora Nome da impressora registrada no windows, caso deseje omitir a tela de seleção de impressora no momento da impressão  ^0"
s[355] = "spdNFe.TspdNFe.ExportarEPEC^spdNFe.TspdNFe.html#ExportarEPEC^^Método utilizado para Exportar a DANFE em contingência EPEC        aLoteNotas Lote XML de NFe Assinado aProtEPEC Número de Protocolo obtido após envio ao WebService de EPEC aDataHoraEPEC Data e Hora de recebimento do EPEC no WebService aArquivoModelo Arquivo (rtm) de layot de impressão (opcional) aFormato Formato da exportação (1-PDF, 2-JPG) aExportarParaArquivo Nome completo do arquivo que será gerado  ^0"
s[356] = "spdNFe.TspdNFe.VisualizarEPEC^spdNFe.TspdNFe.html#VisualizarEPEC^^Método utilizado para Visualizar a DANFE em contingência EPEC      aLoteNotas Lote XML de NFe Assinado aProtEPEC Número de Protocolo obtido após envio ao WebService de EPEC aDataHoraEPEC Data e Hora de recebimento do EPEC no WebService aArquivoModelo Arquivo (rtm) de layot de impressão (opcional)  ^0"
s[357] = "spdNFe.TspdNFe.GerarIdCCe^spdNFe.TspdNFe.html#GerarIdCCe^^Função que gera o ID da Carta de correção Eletrônica, que é usado para gerar o XML Destinatário da CCe.    aChaveNFe Chave na Nota. aSeqEvento Sequência do Evento.  ^0"
s[358] = "spdNFe.TspdNFe.EnviarCCeDestinatario^spdNFe.TspdNFe.html#EnviarCCeDestinatario^^Metodo que envia a CCe para o email do destinatário   aCCe aceita tanto o caminho do arquivo XML quanto a chave da CCe  ^0"
s[359] = "spdNFe.TspdNFe.ImprimirCCe^spdNFe.TspdNFe.html#ImprimirCCe^^Permite imprimir um documento CCe passado como parâmetro em xml.    aXmlCCe XML válido contendo uma CCe aImpressora Nome da impressora a ser utilizada.  ^0"
s[360] = "spdNFe.TspdNFe.VisualizarCCe^spdNFe.TspdNFe.html#VisualizarCCe^^Permite Prever como será impresso um DANFE   aXmlCCe XML de CCe Assinado  ^0"
s[361] = "spdNFe.TspdNFe.EditarModeloCCe^spdNFe.TspdNFe.html#EditarModeloCCe^^Permite editar o modelo para impressão da CCe.   aXmlCCe XML válido contendo uma CCe.  ^0"
s[362] = "spdNFe.TspdNFe.ExportarCCe^spdNFe.TspdNFe.html#ExportarCCe^^Permite exportar a CCe para PDF.    aXmlCCe XML válido contendo uma CCe. aSalvarComo Nome do arquivo a ser salvo.  ^0"
s[363] = "spdNFe.TspdNFe.MontarXmlCCe^spdNFe.TspdNFe.html#MontarXmlCCe^^Permite montar o xml de envio da CCe.        aChaveNFe Chave de Identificação da NF. aTextoCorrecao Texto (mínimo 15 dígitos) para descrição da correção. aDataHoraEvento Data e Hora da Emissão do Evento. Ex.: 2010-08-19T13:00:15 aOrgao Código do Estado do Emissor da NFe. aSequenciaEvento Número do evento (sequencial) aFusoHorario Fuso horário do local de envio. Ex.: -03:00  ^0"
s[364] = "spdNFe.TspdNFe.AssinarCCe^spdNFe.TspdNFe.html#AssinarCCe^^Assina o XML da CCe    aXmlCCe xml da CCe a ser assinada  EspdNFeException Quando o campo Id não for encontrado para na fiscal.^0"
s[365] = "spdNFe.TspdNFe.MontarEPEC^spdNFe.TspdNFe.html#MontarEPEC^^Monta o XML do evento EPEC a partir do xml de envio da nota       ou o xml estiver inválido   aIdLote identificador de controle do lote de envio do evento aXmlEnvio xml de envio da nota (tpemis=4) aDHEvento Data e Hora da Emissão do Evento. Ex.: 2010-08-19T13:00:15 aFusoHorario Fuso horário do local de envio. Ex.: -03:00 o xml da nota EspdEventoCheckParams caso algum parâmetro de entrada ou algum valor no XML EspdEventosException caso não consiga gerar o xml^0"
