s[955] = "spdNFELibrary.AuditarXml^spdNFELibrary.html#AuditarXml^^Função para a validação do auditor fiscal           aXml: xml passado para a validação. aDelimitador: Delimitador necessário para a validação. aServidor: Necessário informar servidor para dar a resposta da validação. aExibirRegra: Exibição das regras de validação. aExibirHtml: Exibição da validação em HTML. aParam: parâmetro não necessário, somente para caso precise futuramente. Retorna um tipo de validação dependendo das propriedades setadas. EspdNFeValidadorClientOCXException: Quando o validadorClient não é instanciado. EspdNFeComunicacaoValidadorNotaException: Quando a comunicação com a validação falhar.^0"
s[956] = "spdNFELibrary.AssinarDPEC^spdNFELibrary.html#AssinarDPEC^^Assina digitalmente o XML (resumido da NFe específico para DPEC) que será enviado ao SEFAZ    aXMLDPEC XML (resumido da NFe específico para DPEC) a ser assinado digitalmente aConfigFilePath caminho para um arquivo ini com configurações  ^0"
s[957] = "spdNFELibrary.EnviarDPEC^spdNFELibrary.html#EnviarDPEC^^Envia um XML de DPEC assinado ao WebService de DPEC (Declaração prévia de Emissão em Contingência)    aDPECAssinado XML de DPEC Assinado aConfigFilePath caminho para um arquivo ini com configurações  ^0"
s[958] = "spdNFELibrary.ConsultarDPEC^spdNFELibrary.html#ConsultarDPEC^^Consulta o registro de um DPEC no WebService do Sefaz nacional     aTpConsulta Tipo da Consulta que será executada [1-Chave da Nfe, 2-Número de Registro do DPEC] aParam nùmero do Documento de acordo com o primeiro parametro aConfigFilePath caminho para um arquivo ini com configurações  ^0"
s[959] = "spdNFELibrary.AssinarNota^spdNFELibrary.html#AssinarNota^^Gera assinatura de cada Nota dentro do arquivo XML     aXML xml da Nota a ser assinado aConfigFilePath caminho para um arquivo ini com configurações atpEmis Tipo de Emissão da Nota que será assinada. Utilize [1-NFe e 2-SCAN]  ^0"
s[960] = "spdNFELibrary.GerarNotasAleatorias^spdNFELibrary.html#GerarNotasAleatorias^^Função que gera Notas Fiscais com numeração Aleatória, utilizado como Demonstração de uso do Componente. Este método será desabilitado nas próximas atualizações.      Qtde Quantidade de NF's que será gerada CNPJ CNPJ do Emitente aConfigFilePath caminho para um arquivo ini com configurações Xml da quantidade de NFs solicitada ^0"
s[961] = "spdNFELibrary.ConverterLoteParaXml^spdNFELibrary.html#ConverterLoteParaXml^^Função que converte um Lote de Nf's formato TXT para XML     de acordo com a Versão do Manual de Integração setada ao componente   ArquivoLoteTxt arquivo com Lote de NF's em formato TXT aConfigFilePath caminho para um arquivo ini com configurações aTipoConversao Tipo de conversão que será utilizada (1-Tx2 / 2-Rec) aVersaoEsquema Versão de esquema que será utilizada na conversão, caso o usuário passe vazio o componente utiliza a última Lote de entrada convertido para formato XML ^0"
s[962] = "spdNFELibrary.StatusDoServico^spdNFELibrary.html#StatusDoServico^^Função que Verifica a situação do serviço WebService solicitado   </p>    <pre class=\"longcode\">      Ex:       _Result := StatusDoServico; </pre>    <p>  aConfigFilePath caminho para um arquivo ini com configurações XML com resultado da operação solicitada ^0"
s[963] = "spdNFELibrary.CancelarNF^spdNFELibrary.html#CancelarNF^^Função que envia solicitação de Cancelamento da NF      </p>    <pre class=\"longcode\">      Ex:       _Result := CancelarNF(<span class=\"pascal_string\">'098909012345555090290124509890223879820934212'</span>,<span class=\"pascal_string\">'098950000123463'</span>,<span class=\"pascal_string\">'emitente incorreto'</span>);</pre>    <p>   aNotaID Chave de Identificação da NF aNumProtocolo Número do Protocolo de registro da NF, que deve conter exatamente 15 dígitos aJustificativa Texto (mínimo 15 dígitos) para descrição do Motivo de cancelamento da NF aConfigFilePath caminho para um arquivo ini com configurações XML com o resultado da operação solicitada EspdNFeCheckParams Levantada quando os parâmetros estiverem com acento ou diferentes do tamanho exigido.^0"
s[964] = "spdNFELibrary.ConsultarNF^spdNFELibrary.html#ConsultarNF^^Função para consultar NF no servidor    </p>    <pre class=\"longcode\">      Ex:       _Result := ConsultaNF(<span class=\"pascal_string\">'098909012345555090290124509890223879820934212'</span>); </pre>    <p>   aNotaID Chave de Identificação da NF aConfigFilePath caminho para um arquivo ini com configurações XML com o resultado da operação solicitada EspdNFeCheckParams Levantada quando os parâmetros estiverem com acento ou diferentes do tamanho exigido.^0"
s[965] = "spdNFELibrary.InutilizarNF^spdNFELibrary.html#InutilizarNF^^Função que solicita a Inutilização de Numeração.          </p>    <pre class=\"longcode\">      ex:        Result := fNF.CancelarNF(<span class=\"pascal_string\">'35080677917680004205550010000011450045364376'</span>,<span class=\"pascal_string\">'135080000000001'</span>,<span class=\"pascal_string\">'123456789123456'</span>); </pre>    <p>   aNotaID Chave de Identificação da NF aAno Ano de inutilização da numeração aCNPJ CNPJ do emitente aModelo Modelo da NFe aSérie Série da NFe aNFIni Número da NFe inicial a ser inutilizada aNFFin Número da NFe final a ser inutilizada aConfigFilePath caminho para um arquivo ini com configurações XML contendo a mensagem do resultado da solicitação EspdNFeCheckParams Levantada quando os parâmetros estiverem com acento ou diferentes do tamanho exigido.^0"
s[966] = "spdNFELibrary.EnviarNF^spdNFELibrary.html#EnviarNF^^Função para Enviar Lote das NF's assinadas.        aNumLote Número de Identificação do Lote a ser enviado. aLoteNotas XML das NF's encapsuladas no Lote. aCompactado define se o XML de envio será compactado ou não aConfigFilePath caminho para um arquivo ini com configurações Xml contendo mensagem do resultado da solicitaçao. EspdNFeCheckParams Levantada quando os parâmetros estiverem com acento ou diferentes do tamanho exigido.^0"
s[967] = "spdNFELibrary.EnviarNFSincrono^spdNFELibrary.html#EnviarNFSincrono^^Função para Enviar Lote das NF's assinadas.        aNumLote Número de Identificação do Lote a ser enviado. aLoteNota XML contendo somente uma NFe encapsulada no Lote. aCompactado define se o XML de envio será compactado ou não aConfigFilePath caminho para um arquivo ini com configurações Xml contendo mensagem do resultado da solicitaçao. EspdNFeCheckParams Levantada quando os parâmetros estiverem com acento ou diferentes do tamanho exigido.^0"
s[968] = "spdNFELibrary.ConsultarRecibo^spdNFELibrary.html#ConsultarRecibo^^Função que verifica a Situação do Recibo (que pode conter várias NFs).    </p>    <pre class=\"longcode\">      ex:       _Result := ConsultarRecibo(<span class=\"pascal_string\">'009098765436527'</span>); </pre>    <p>   aNumRecibo Número do Recibo que deve conter 15 dígitos. aConfigFilePath caminho para um arquivo ini com configurações Retorna Xml contendo mensagem do resultado da solicitação. EspdNFeCheckParams Levantada quando os parâmetros estiverem com acento ou diferentes do tamanho exigido.^0"
s[969] = "spdNFELibrary.ConsultarCadastro^spdNFELibrary.html#ConsultarCadastro^^Função para consultar cadastro do Contribuinte      </p>    <pre class=\"longcode\">      ex:       _Result := ConsultarCadastro(<span class=\"pascal_string\">'0000000000000000'</span>); </pre>    <p>  aDocumento Documento a ser consultado aTpDocumento Tipo de Documento = (CNPJ, IE, CPF) aUF UF - Estado do Contribuinte que está sendo consultado aConfigFilePath caminho para um arquivo ini com configurações Retorna XML contendo mensaegm do resultado da solicitação.(Dados do Contribuinte) ^0"
