s[977] = "spdNFELibrary.EditarModeloDanfe^spdNFELibrary.html#EditarModeloDanfe^^Permite editar o modelo para impressão do DANFE. Para utilizar o modelo alterado, é necessário salvar o arquivo com extensão RTM e utilizá-lo nas chamadas de <a class=\"normal\"  href=\"spdNFELibrary.html#VisualizarDanfe\">VisualizarDanfe</a> e <a class=\"normal\"  href=\"spdNFELibrary.html#ImprimirDanfe\">ImprimirDanfe</a>. Os parâmetro do método são os mesmos dos citados, para permitir a edição de um relatório com os campos preenchidos   passar o XML Destinatário que contém os dados de Autorização da NFe.    aNumLote Número de Identificação do Lote de notas a ser impresso. aLoteNotas xml válido contendo Notas Fiscais eletrônicas (NFe). Em caso de Missão em FS passar somente o XMLAssinado, caso contrário aArquivoModelo caminho para arquivo de modelo do DANFE (extensão RTM), se deixar em branco será utilizado o modelo padrão, localizado no diretório de Templates, subdiretório Danfe aConfigFilePath caminho para um arquivo ini com configurações  ^0"
