s[979] = "spdNFELibrary.ExportarDanfe^spdNFELibrary.html#ExportarDanfe^^Permite exportar a DANFE para os formatos PDF e JPG.   passar o XML Destinatário que contém os dados de Autorização da NFe.     aNumLote número do lote da NFe aLoteNotas xml válido contendo Notas Fiscais eletrônicas (NFe). Em caso de Missão em FS passar somente o XMLAssinado, caso contrário aArquivoModelo caminho para arquivo de modelo do DANFE (extensão RTM), se deixar em branco será utilizado o modelo padrão, localizado no diretório de Templates, subdiretório Danfe, com o nome modelo.RTM aFormato valor inteiro que corresponde ao formato desejado. Escolha 1 para PDF e 2 para JPG. O valor padrão é 1. aConfigFilePath caminho para um arquivo ini com configurações  ^0"
