s[987] = "spdNFELibrary.ListarLogs^spdNFELibrary.html#ListarLogs^^Lista todos os logs ou filtra de acordo com o filtro passado em aFilter    <p>Os valores para filtro que podem ser passado em aFilter são:    <p>0: lista todos os arquivos XML. É o valor padrão. 1: lista arquivos de NFe 2: lfEnvLot lista arquivos de envio de lote de NFe 3: lfRec lista arquivos de recibo 4: lfPedRec lista arquivos de pedido do resultado do processamento do lote de NFe 5: lfProRec lista arquivos de resultado do processamento do lote de NFe 6: lfDen lista arquivos de denegação de uso 7: lfPedCan lista arquivos de pedido de cancelamento de NFe 8: lfCan lista arquivos de cancelamento de NFe 9: lfPedInu lista arquivos de pedido de inutilização de numeração 10: lfInu lista arquivos de inutilização de numeração 11: lfPedSit lista arquivos de pedido de consulta de situação atual da NFe 12: lfSit lista arquivos de situação atual da NF-e 13: lfPedSta lista arquivos de pedido de consulta de status do serviço 14: lfSta lista arquivos de status de serviço 15: lfCustom lista arquivos obtidos através de um filtro personalizado pelo usuário em aCustomFilter    ^0"
s[988] = "spdNFELibrary.LerLog^spdNFELibrary.html#LerLog^^Lê o conteúdo do arquivo de log especificado em aPathArquivoLog e retorna o valor em uma WideString     <p>Exemplo: </p>    <pre class=\"longcode\">LerLog(PCHAR(<span class=\"pascal_string\">'c:\\NFE\\log\\0001-env-lot.xml'</span>))</pre>    <p>  aPathArquivoLof caminho completo para o arquivo do log.  ^0"
