s[1000] = "spdNFELibrary.EnviarManifestacaoDestinatario^spdNFELibrary.html#EnviarManifestacaoDestinatario^^Função para o envio de Manifestação de Destinatário.  Desconhecimento da operação (tmdDesconhecimentoOperacao), Operação não Realizada (tmdOperacaoNaoRealizada) e Ciência da operação (tmdCienciaOperacao).          aTpEvento tipo do evento que deseja enviar: Confirmação da operação (tmdConfimacaoOperacao), aNotaID Chave de Acesso da NF-e vinculada ao Evento. aCNPJCPF Informar o CNPJ ou o CPF do autor do Evento. aJustificativa Justificativa para manifestação. aDataHoraEvento Data e Hora do evento. aSequencia Número sequêncial do evento. aFusoHorario Fuso horário. aConfigFilePath caminho para um arquivo ini com configurações XML com o resultado da operação solicitada ^0"
s[1001] = "spdNFELibrary.ConsultarNFeDestinadas^spdNFELibrary.html#ConsultarNFeDestinadas^^Função de &quot;Consulta da Relação de Documentos Destinados para um determinado CNPJ  2 para &quot;Idem anterior, incluindo as NF-e que também não tiveram a Ciência da Operação&quot;)  1 para &quot;Somente as NF-e emitidas por emissores / remetentes que não tenham a mesma raiz do CNPJ do destinatário (para excluir as notas fiscais de transferência entre filiais)&quot;)  consulta retornará unicamente as notas fiscais que tenham sido recepcionadas nos últimos 15 dias)    aIndNFe Indicador de NF-e consultada. Utilizar: (0 para &quot;Todas as NF-e&quot;; 1 para &quot;Somente as NF-e sem manifestação&quot;; aIndEmi Indicador do Emissor da NF-e. Utilizar: (0 para &quot;Todos os Emitentes / Remetentes&quot;; aUltNSU Último NSU recebido pela Empresa (Caso seja informado com zero, ou com um NSU muito antigo, a aConfigFilePath caminho para um arquivo ini com configurações XML com o resultado da operação solicitada ^0"
s[1002] = "spdNFELibrary.CancelarNFeEventoIdLote^spdNFELibrary.html#CancelarNFeEventoIdLote^^Função que envia solicitação de Cancelamento de uma NFe como um evento.                </p>    <pre class=\"longcode\">       Ex:        _Result := CancelarNFeEvento(<span class=\"pascal_string\">'098909012345555090290124509890223879820934212'</span>,<span class=\"pascal_string\">'098950000123463'</span>,<span class=\"pascal_string\">'emitente incorreto'</span>,        <span class=\"pascal_string\">'2012-05-15T15:30:30'</span>, <span class=\"pascal_numeric\">1</span>, <span class=\"pascal_string\">'-03:00'</span>);    </pre>    <p>  aNotaID Chave de Identificação da NF aNumProtocolo Número do Protocolo de registro da NF, que deve conter exatamente 15 dígitos aJustificativa Texto (mínimo 15 dígitos) para descrição do Motivo de cancelamento da NF aDataHoraEvento Data e Hora da Emissão do Evento Ex.: 2010-08-19T13:00:15 aFusoHorario Fuso horário do local de envio. Ex.: -03:00 aConfigFilePath caminho para um arquivo ini com configurações aSequenciaEvento é o numero do evento XML com o resultado da operação solicitada. EspdNFeEventosNumeroProtException Quando número do protocolo não é informado EspdNFeEventosFusoHorarioInvalidException quando formato fuso horário informado é inválido. EspdNFeEventosDataHoraInvalidException quando Data Hora informada é inválida. EspdNFeEventosUFInvalidException quando UF não é definida. EspdNFeEventosChaveInvalidException quando Chave da NFe informada é inválida. EspdNFeEventosCodigoOrgaoInvalidException quando código do orgão é inválido. EspdNFeEventosJustificativaInvalidException quando justificativa informada é inválida^0"
s[1003] = "spdNFELibrary.CancelarNFeEvento^spdNFELibrary.html#CancelarNFeEvento^^Função que envia solicitação de Cancelamento de uma NFe como um evento.                  </p>    <pre class=\"longcode\">       Ex:        _Result := CancelarNFeEvento(<span class=\"pascal_string\">'098909012345555090290124509890223879820934212'</span>,<span class=\"pascal_string\">'098950000123463'</span>,<span class=\"pascal_string\">'emitente incorreto'</span>,        <span class=\"pascal_string\">'2012-05-15T15:30:30'</span>, <span class=\"pascal_numeric\">1</span>, <span class=\"pascal_string\">'-03:00'</span>,<span class=\"pascal_numeric\">1</span>);    </pre>    <p>  aNotaID Chave de Identificação da NF aNumProtocolo Número do Protocolo de registro da NF, que deve conter exatamente 15 dígitos aJustificativa Texto (mínimo 15 dígitos) para descrição do Motivo de cancelamento da NF aDataHoraEvento Data e Hora da Emissão do Evento Ex.: 2010-08-19T13:00:15 aFusoHorario Fuso horário do local de envio. Ex.: -03:00 aConfigFilePath caminho para um arquivo ini com configurações aSequenciaEvento é o numero do evento aIdLote ID do Lote da nota no qual o Cancelamento será vinculado. atpEmis Tipo de Emissão da nota fiscal. 1 = Normal e 2 = Scan. Com valor padrão de 1. XML com o resultado da operação solicitada. EspdNFeEventosNumeroProtException Quando número do protocolo não é informado EspdNFeEventosFusoHorarioInvalidException quando formato fuso horário informado é inválido. EspdNFeEventosDataHoraInvalidException quando Data Hora informada é inválida. EspdNFeEventosUFInvalidException quando UF não é definida. EspdNFeEventosChaveInvalidException quando Chave da NFe informada é inválida. EspdNFeEventosCodigoOrgaoInvalidException quando código do orgão é inválido. EspdNFeEventosJustificativaInvalidException quando justificativa informada é inválida^0"
s[1004] = "spdNFELibrary.DownloadNFe^spdNFELibrary.html#DownloadNFe^^Função de &quot;Download NFe&quot; do servidor da Sefaz.       </p>    <pre class=\"longcode\">       Ex:        _Result := DownloadNFe(<span class=\"pascal_string\">'098909012345555090290124509890223879820934212,098909012345555090290124509890223879820934212'</span>);    </pre>    <p>  aChaves Chave das NF-e que seja realizar download (Seperadas por vírgula) aConfigFilePath caminho para um arquivo ini com configurações Retorna XML contendo mensaegm do resultado da solicitação. EspdNFeEventosCNPJInvalidException quando CNPJ configurado é inválido EspdNFeEventosChaveInvalidException quando pelo menos uma das chaves informadas é inválida EspdNFeEventoDownloadLimitNotasException quando informado mais que 10 chaves^0"
s[1005] = "spdNFELibrary.ValidarLoteParaEnvio^spdNFELibrary.html#ValidarLoteParaEnvio^^Valida Lote de Notas, realizando vários procedimentos, desde verificação de assinatura, até validação do xml de acordo com o esquema requerido para envio das notas      aNumLote Número do lote de notas, para montagem do xml aLoteNotas Lote de Notas a ser avaliado  EspdNFeSchemaNotFoundException Quando o XML não puder ser validado por não indicar o arquivo esquema EspdNFeCheckParams Levantada quando os parâmetros estiverem com acento ou diferentes do tamanho exigido.^0"
s[1006] = "spdNFELibrary.ValidarTamanhoArquivoEnvio^spdNFELibrary.html#ValidarTamanhoArquivoEnvio^^Valida o Tamanho máximo do XML de Envio baseado na configuração da propriedade MaxSizeLoteEnvio    aLoteNotas Lote de Notas a ser avaliado  EspdNFeMaxSizeException Quando o XML estiver com tamanho acima do permitido^0"
